import { Component } from "react";
import HomePgImg1 from "../assests/img2.jpg";
import HomePgImg2 from "../assests/img2.jpg";
import HomePgImg3 from "../assests/img2.jpg";
import HomePgImg4 from "../assests/img2.jpg";
import "./HPgstyles";

class HPData extends Component {
    render(){
        return(
            <div className = "first-page">
                <div className = "fp-text">
                    <h2>{this.props.headi}</h2>
                    <p>Our NGO is committed to creating a brighter future for the underprivileged and vulnerable communities. With unwavering dedication, we strive to alleviate poverty, provide access to quality education, healthcare, and essential resources, and empower individuals to lead dignified lives. Through the support of compassionate individuals like you, we've achieved impactful change and transformed countless lives. Join us in this journey of hope and transformation, as your contribution, no matter how small, can make a profound difference. Together, we can build a world where every individual has the opportunity to thrive and fulfill their potential. Thank you for being a part of our mission.</p>
                </div>

                <div className="image">
                    <img alt="img" src={HomePgImg1} />
                    <img alt="img" src={HomePgImg2} />
                </div>
            </div>
        )
    }
}

export default HPData;
